<html>

<head>



    <style>
        html {
            zoom: 0.55;
            background-color: white;
        }

        body {
            direction: rtl;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            border: 1px solid rgb(0, 0, 0);
            min-width: 680px;
        }

        td {
            border-top: 1px solid rgb(0, 0, 0);
            border-right: 1px solid rgb(0, 0, 0);
            padding: 5px;
        }

        .headertr {
            font-style: b;
        }

        .bold-font {
            font-weight: bold;
            font-family: Tahoma;
            font-style: normal;
            font-size: 12pt;
            color: #000000;
        }

        .font {
            font-style: normal;
            font-weight: normal;
            font-size: 12pt;
            font-family: Tahoma;
            color: #000000
        }

        .container {
            display: flex;
            width: 100%;
            min-width: 100vw !important;
        }

        .subheader {
            display: flex;
            justify-content: space-between;
            width: 90% !important;
            min-width: 90vw !important;
            padding: 15px;
            /* background-color: blueviolet; */
        }

        /* colors */
        .first-column {
            /* background-color: #74e590; */
            /* float: right */
                /* margin-left: 90px; */
        }

        .second-column {
            /* background-color: #ff6666; */
            /* float: left */
        }

        .border-container {
            display: inline-block;
            border: 1px solid #000000;
            padding: 10px;
            width: 100%;
            max-width: 600px;
        }

        .underline-text {
            text-decoration: underline;
            text-decoration-thickness: 2px;
            /* Adjust thickness as needed */
            text-decoration-color: black;
            /* Adjust color as needed */
            font-weight: bold;
            font-family: Tahoma;
            font-size: 12pt;
        }

        .section {
            margin-bottom: 10px;
            /* Optional: Add margin between sections */
        }

        .yellow {
            /* background-color: yellow; */
        }
    </style>
</head>
